import styled from "styled-components";
import MainSecIconsService from "./MainSecIconsService"


const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    padding: 2rem;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const Div = styled.div`
    max-width: 1080px;
    margin: 0 auto;
`

const Title = styled.h1`
    font-size: 2rem;
    font-weight: normal;
    text-align: center;
    margin: 2.5rem;
`


function Section06() {
    return (
        <SectionCTA>
            <Div><Title>¿Qué ofrecemos?</Title>
                <MainSecIconsService />
            </Div>
        </SectionCTA>
    )
};

export default Section06;
